import React, { Component } from 'react';
import '../user/parameters.css'
import avatar from '../../images/avatar.jpg'

export class Parameters extends Component {
    render(){
        return (
        <div>
            <div className="card">
                <div className="row">
                    <div className="col-md-4">
                        <img src={avatar} className='avatar'></img>
                    </div>
                </div>                     
            </div>
        </div>
        );
    }
}
